webpackJsonp([0xd5f2df87f847],{1666:function(a,n){a.exports={data:{markdownRemark:{html:'<p>Trong <a href="http://aquabubu.com/vi/Japanese-cuisine-Part-1/" target="_blank">bài viết trước</a>, mình đã giới thiệu các món ăn chính ở Nhật. Bây giờ mình sẽ giới thiệu các món ăn vặt ngon và độc đáo của họ nhé. ^^</p>\n<h3 id="span-stylecolorroyalblueokonomiyaki-お好み焼きspan"><a href="#span-stylecolorroyalblueokonomiyaki-%E3%81%8A%E5%A5%BD%E3%81%BF%E7%84%BC%E3%81%8Dspan" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:royalblue">Okonomiyaki (お好み焼き)</span></h3>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/okonomiyaki-bfdc58e3f809b649b173d5da83b06997-99430.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 96.0759493670886%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="okonomiyaki" title="" src="/static/okonomiyaki-bfdc58e3f809b649b173d5da83b06997-99430.png" srcset="/static/okonomiyaki-bfdc58e3f809b649b173d5da83b06997-0a375.png 300w,\n/static/okonomiyaki-bfdc58e3f809b649b173d5da83b06997-71980.png 600w,\n/static/okonomiyaki-bfdc58e3f809b649b173d5da83b06997-99430.png 790w" sizes="(max-width: 790px) 100vw, 790px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Đây chính là món bánh xèo của ngwơif Nhật đấy. Bánh xèo với nhân chủ yếu là thịt heo và rau bắp cải, được chiên trong chảo dầu nóng. Khi ăn thì xịt tương  Worcester lên. Món này ăn ngon và là một trong những món mình thích nhất ở Nhật.</p>\n<h3 id="span-stylecolorcoralyakitori-焼鳥span-"><a href="#span-stylecolorcoralyakitori-%E7%84%BC%E9%B3%A5span-" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:coral">Yakitori (焼鳥)</span ></h3>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/yakitori-e8205195423b175a54e02fd016830225-6d80a.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 871px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 74.97129735935707%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="yakitori" title="" src="/static/yakitori-e8205195423b175a54e02fd016830225-6d80a.png" srcset="/static/yakitori-e8205195423b175a54e02fd016830225-12144.png 300w,\n/static/yakitori-e8205195423b175a54e02fd016830225-a4942.png 600w,\n/static/yakitori-e8205195423b175a54e02fd016830225-6d80a.png 871w" sizes="(max-width: 871px) 100vw, 871px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Đây là món gà xiên nướng, món này ăn cũng bình thường thôi. Nhưng kiểu ở Nhật người ta ăn với sốt riêng và hay bán dọc các con đường nên dễ ăn và nhiều người biết đến.</p>\n<h3 id="spanspan-stylecolordarkturquoisenikuman-ニクマンspan"><a href="#spanspan-stylecolordarkturquoisenikuman-%E3%83%8B%E3%82%AF%E3%83%9E%E3%83%B3span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a></span><span style="color:darkturquoise">Nikuman (ニクマン)</span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/nikuman-13d09244f977306d77d7f1af2d0a0b78-3448c.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 521px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 67.75431861804223%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="nikuman" title="" src="/static/nikuman-13d09244f977306d77d7f1af2d0a0b78-3448c.png" srcset="/static/nikuman-13d09244f977306d77d7f1af2d0a0b78-46a5e.png 300w,\n/static/nikuman-13d09244f977306d77d7f1af2d0a0b78-3448c.png 521w" sizes="(max-width: 521px) 100vw, 521px">\n    </span>\n  </span>\n  \n  </a>\n     Món này y chang bánh bao thôi. Ăn cũng ngon, nhưng mình vẫn thích bánh bao Việt Nam nhất.😄</p>\n<h3 id="span-stylecolorredikayaki-イカ焼きspan"><a href="#span-stylecolorredikayaki-%E3%82%A4%E3%82%AB%E7%84%BC%E3%81%8Dspan" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:red">Ikayaki (イカ焼き)</span></h3>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/ikayaki-0c285bf51a973a1529aa56f9e31317fe-41d41.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 523px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 81.07074569789675%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="ikayaki" title="" src="/static/ikayaki-0c285bf51a973a1529aa56f9e31317fe-41d41.png" srcset="/static/ikayaki-0c285bf51a973a1529aa56f9e31317fe-9eb6b.png 300w,\n/static/ikayaki-0c285bf51a973a1529aa56f9e31317fe-41d41.png 523w" sizes="(max-width: 523px) 100vw, 523px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Món này là nguyên con mực (đã bỏ ruột) xiên vô que rồi nướng. Ăn vặt cũng ok lắm.</p>\n<h3 id="span-stylecolormediumvioletredtakoyaki-たこ焼きspan"><a href="#span-stylecolormediumvioletredtakoyaki-%E3%81%9F%E3%81%93%E7%84%BC%E3%81%8Dspan" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:mediumvioletred">Takoyaki (たこ焼き)</span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/takoyaki-8ec68dd30226a7669bc4b8b0e87cb46e-0a252.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 658px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 68.54103343465046%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="takoyaki" title="" src="/static/takoyaki-8ec68dd30226a7669bc4b8b0e87cb46e-0a252.png" srcset="/static/takoyaki-8ec68dd30226a7669bc4b8b0e87cb46e-1fb30.png 300w,\n/static/takoyaki-8ec68dd30226a7669bc4b8b0e87cb46e-e0c9c.png 600w,\n/static/takoyaki-8ec68dd30226a7669bc4b8b0e87cb46e-0a252.png 658w" sizes="(max-width: 658px) 100vw, 658px">\n    </span>\n  </span>\n  \n  </a>\n     Takoyaki huyền thoại đây mọi người ạ. Bánh bột hình khối tròn, bên trong là 1 miếng bạch tuộc. Ở Nhật cái nhân bạch tuộc bên trong chất lượng hơn ở Việt nhé.😆</p>\n<h3 id="span-stylecolordeeppinksenbei-せんべいspan"><a href="#span-stylecolordeeppinksenbei-%E3%81%9B%E3%82%93%E3%81%B9%E3%81%84span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:deeppink">Senbei (せんべい)</span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/senbei-6a2cf7ec30a57d5b069fd10cd689873b-60ced.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 602px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 74.91694352159469%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="senbei" title="" src="/static/senbei-6a2cf7ec30a57d5b069fd10cd689873b-60ced.png" srcset="/static/senbei-6a2cf7ec30a57d5b069fd10cd689873b-34918.png 300w,\n/static/senbei-6a2cf7ec30a57d5b069fd10cd689873b-652af.png 600w,\n/static/senbei-6a2cf7ec30a57d5b069fd10cd689873b-60ced.png 602w" sizes="(max-width: 602px) 100vw, 602px">\n    </span>\n  </span>\n  \n  </a>\n     Đây là món bánh gạo, ăn được. Đây là món yêu thích của mấy em hươu nai ở <a href="http://aquabubu.com/vi/Japan-travel-Nara-Deer-Park/" target="_blank">công viên Nara</a> nhé.</p>\n<h3 id="span-stylecolorgreenoden-おでんspan"><a href="#span-stylecolorgreenoden-%E3%81%8A%E3%81%A7%E3%82%93span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:green">Oden (おでん)</span></h3>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/oden-e90e01a9c182c5f0adb8d35ce1b4cc89-5f9af.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 616px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 71.91558441558442%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="oden" title="" src="/static/oden-e90e01a9c182c5f0adb8d35ce1b4cc89-5f9af.png" srcset="/static/oden-e90e01a9c182c5f0adb8d35ce1b4cc89-e3f69.png 300w,\n/static/oden-e90e01a9c182c5f0adb8d35ce1b4cc89-990cf.png 600w,\n/static/oden-e90e01a9c182c5f0adb8d35ce1b4cc89-5f9af.png 616w" sizes="(max-width: 616px) 100vw, 616px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Đây là món lẩu bánh cá. Bánh cá ở Nhật giống giống chả cá bên mình, nhưng ăn nhiều bột hơn nên mình không thích lắm. Ăn thử một lần cho biết cũng được nhé. </p>\n<h3 id="span-stylecolordodgerblue-dorayaki-どら焼きspan"><a href="#span-stylecolordodgerblue-dorayaki-%E3%81%A9%E3%82%89%E7%84%BC%E3%81%8Dspan" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:dodgerblue"> Dorayaki (どら焼き)</span></h3>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/dorayaki-b19134d4f11b739fb458ea2539805e31-37e8a.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 543px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 101.84162062615101%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="dorayaki" title="" src="/static/dorayaki-b19134d4f11b739fb458ea2539805e31-37e8a.png" srcset="/static/dorayaki-b19134d4f11b739fb458ea2539805e31-e88ba.png 300w,\n/static/dorayaki-b19134d4f11b739fb458ea2539805e31-37e8a.png 543w" sizes="(max-width: 543px) 100vw, 543px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Có ai là fan doraemon giống mình không nhỉ? Bánh rán huyền thoại bạn Mèo ú thích đây. Bột bánh ăn ngon nhưng mình không thích nhân đậu đỏ lắm.</p>\n<h3 id="span-stylecolorolivedrabmochi-餅span"><a href="#span-stylecolorolivedrabmochi-%E9%A4%85span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:olivedrab">Mochi (餅)</span></h3>\n<p>Mochi là bánh gạo Nhật Bản. Có nhiều loại mochi lắm, hầu hết là các món ngọt. Ai thích đồ ngọt thì không thể bỏ qua đâu nhé.</p>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/mochi-b40b4ce3c0876b74ad26b72752907fc2-1ffcd.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 70.8523592085236%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="mochi" title="" src="/static/mochi-b40b4ce3c0876b74ad26b72752907fc2-abe1c.png" srcset="/static/mochi-b40b4ce3c0876b74ad26b72752907fc2-10046.png 300w,\n/static/mochi-b40b4ce3c0876b74ad26b72752907fc2-3c4a3.png 600w,\n/static/mochi-b40b4ce3c0876b74ad26b72752907fc2-abe1c.png 1200w,\n/static/mochi-b40b4ce3c0876b74ad26b72752907fc2-1ffcd.png 1314w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<ul>\n<li>\n<p><strong>Daifuku (大福)</strong> - Bánh gạo nhân sốt đậu đỏ ngọt.</p>\n</li>\n<li>\n<p><strong>Ichigo Daifuku (いちご大福)</strong> - Một phiên bản khác của daifuku với nhân trái cây.</p>\n</li>\n<li>\n<p><strong>Kusa Mochi (草餅)</strong> - Mochi xanh có rắc bột cây ngải cứu lên trên.</p>\n</li>\n<li>\n<p><strong>Mochi ice cream (もちアイス)</strong> - Mochi nhiều màu sắc với nhân kem bên trong.</p>\n</li>\n<li>\n<p><strong>Oshiruko (おしるこ)</strong> - Món chè đậu đỏ này có cho vài miếng bánh gạo bên trong.</p>\n</li>\n</ul>\n<h3 id="spanspan-stylecolorplumchocolate-banana-チョコバナナspan"><a href="#spanspan-stylecolorplumchocolate-banana-%E3%83%81%E3%83%A7%E3%82%B3%E3%83%90%E3%83%8A%E3%83%8Aspan" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a></span><span style="color:plum">Chocolate Banana (チョコバナナ)</span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/chocolatebanana-74c9b9fc9999e43ff6e5f6aa3ba0b656-dc9e0.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 483px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 96.27329192546583%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="chocolatebanana" title="" src="/static/chocolatebanana-74c9b9fc9999e43ff6e5f6aa3ba0b656-dc9e0.png" srcset="/static/chocolatebanana-74c9b9fc9999e43ff6e5f6aa3ba0b656-33baf.png 300w,\n/static/chocolatebanana-74c9b9fc9999e43ff6e5f6aa3ba0b656-dc9e0.png 483w" sizes="(max-width: 483px) 100vw, 483px">\n    </span>\n  </span>\n  \n  </a>\n     Món này nhìn hay nè các bạn. Quả chuối được phủ socola (socola sữa, đen hoặc trăng), rồi rắc kẹo trang trí hạt nhiều màu sắc lên.</p>\n<h3 id="span-stylecolormediumseagreennamagashi-生菓子span"><a href="#span-stylecolormediumseagreennamagashi-%E7%94%9F%E8%8F%93%E5%AD%90span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:mediumseagreen">Namagashi (生菓子)</span></h3>\n<figure style="width: 600px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/namagashi-f1da7aad61cec93b7d68970a0f80e7df-3f7cd.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 502px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 59.561752988047814%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="namagashi" title="" src="/static/namagashi-f1da7aad61cec93b7d68970a0f80e7df-3f7cd.png" srcset="/static/namagashi-f1da7aad61cec93b7d68970a0f80e7df-f0ef0.png 300w,\n/static/namagashi-f1da7aad61cec93b7d68970a0f80e7df-3f7cd.png 502w" sizes="(max-width: 502px) 100vw, 502px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Namagashi là một loại món tráng miệng truyền thống của Nhật Bản với các món đồ ngọt được làm với hình dáng và màu sắc cực bắt mắt. Món này thường được phục vụ trong các buổi tiệc trà.</p>',
timeToRead:4,excerpt:"Trong  bài viết trước , mình đã giới thiệu các món ăn chính ở Nhật. Bây giờ mình sẽ giới thiệu các món ăn vặt ngon và độc đáo của họ nhé…",frontmatter:{title:"Ẩm thực Nhật Bản - Phần 2",cover:"/images/jcuisine2.png",date:"2016/11/15",category:"Cuisine",tags:["Cuisine","japan","what-to-eat","nhat-ban","am-thuc"]},fields:{slug:"/vi/Japanese-cuisine-Part-2/"}}},pathContext:{path:"/vi/Japanese-cuisine-Part-2/",langKey:"vi"}}}});
